import React , {Component} from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
class Register extends Component{
    render(){
        return (
            <div>
                <h1>Register</h1>
                <Input props = {x = "Firstname"}/>
                <Input props = {x = "Lastname"}/>
                <Input props = {x = "Username"}/>
                <Input props = {x = "Email"}/>
                <Input props = {x = "Password"}/>
                <Input props = {x = "ConfirmPassword"}/>

                <Button variant="outlined" color="primary">Register</Button>

            </div>
        ) 
    }
}

const Input = () =>{
    return (
        <div>
            <TextField
                id="outlined-dense-multiline"
                label={this.props.x}
                margin="dense"
                variant="outlined"
                multiline
                rowsMax="4"
            /> 
        </div>
    )
}

export default Register;
